import React from "react";
import ProjectCompo from "./ProjectCompo";
function projects() {
  let data = {
    kasper : {
      name: "Kasper website",
      date: "2022 Apr - 2022 Apr",
      info: "This Website was a template on internet , I liked it , andchallenge my self to build it",
      link: "https://kasper-khaled.netlify.app",
    },
    gaming : {
      name:"gaming website",
      date:"2021 nov - 2021 nov",
      info:"Website to show the new games and sell it online to the users",
      link:"https://gaming-khaled.netlify.app"
    },
  };
  return (
    <div class="projects pb">
      <div class="container">
        <div class="heading-container">
          <h1 class="main-heading">work/projects</h1>
        </div>
        <div class="info">
          <ProjectCompo {...data.kasper} />
          <ProjectCompo {...data[1]} />

          <ProjectCompo
            name="Rock , Paper and Scisser Game"
            date="2022 Mar - 2022 Mar"
            info="  Website for playing Rock , Paper and Scisser Game using pure
            javascript"
            link="https://khaled-game.netlify.app"
          />

          <ProjectCompo
            name="my resume"
            date="2021 mar - 2021 mar"
            info="Website to show my profile , contain some of my projects , my
            scoial media accounts and some ways to content my "
            link="https://profile-khlaed.netlify.app"
          />
        </div>
      </div>
    </div>
  );
}
export default projects;
